import React from 'react';


function OneMovie(props)  {
  const { backdrop_path } = props.movie; 

  return(
	  <div>
	  	<img src={`http://image.tmdb.org/t/p/original/${backdrop_path}`}/>
	  </div>
  	)	  
}



export default OneMovie;
